        <>
        <style type="text/css">
        {`
        .btn-flat {
        background-color: grey;
        color: white;
        }

        .btn-xxl {
        padding: 2rem 1.5rem;
        font-size: 2.5rem;
        }
    `}
      </style>
        <Stack direction="horizontal" gap={3}>
        <Button variant="flat" size="m"> Create your trip </Button>
        </Stack>
        </>
    );
}

export default CreateItinerary;
